                                              </p>
                            <p> My GitHub repo for this sight is <a target="_blank" rel="noopener noreferrer" href="https://github.com/viant3/reactportfolio">HERE</a>.</p>
                            
                        </div>
                        </div>  
             
        );
    };


export default About;
